B.MA=new A.ca("Mi amor por ti es como el universo, infinito e inmenso.","\u2728")
B.MP=new A.ca("Cada d\xeda a tu lado es mi d\xeda favorito.","\u2764\ufe0f")
B.MR=new A.ca("Eres mi persona favorita en todo el mundo, hoy y siempre.","\ud83e\udd70")
B.MS=new A.ca("Contigo, cada momento se convierte en un hermoso recuerdo.","\ud83d\udcf8")
B.MD=new A.ca("No sab\xeda lo que era el amor verdadero hasta que te conoc\xed.","\ud83d\udc96")
