B.MO=new A.ca("Eres la respuesta a todas mis oraciones y el deseo de mi coraz\xf3n.","\ud83d\ude4f")
B.MY=new A.ca("Quiero pasar el resto de mi vida descubriendo el resto de ti.","\ud83d\udd0e")
B.ML=new A.ca("Incluso en mis sue\xf1os, tu eres mi dulce realidad.","\ud83d\udcad")
B.MB=new A.ca("Gracias por existir y por hacerme tan feliz.","\ud83e\udd73")
B.MU=new A.ca("Eres mi inspiraci\xf3n, mi fortaleza y mi mayor alegr\xeda.","\ud83d\udcaa")
B.MH=new A.ca("Solo necesito tres cosas en la vida: el sol para el d\xeda, la luna para la noche y t\xfa para siempre.","\u2600\ufe0f\ud83c\udf19")
