B.MF=new A.ca("Eres la raz\xf3n por la que creo en la magia.","\ud83d\udcab")
B.Mx=new A.ca("Mi coraz\xf3n te pertenece por completo.","\ud83d\udc98")
B.My=new A.ca("Tu amor es el tesoro m\xe1s grande que tengo.","\ud83d\udc8e")
B.MC=new A.ca("Amo cada peque\xf1o detalle de ti.","\ud83e\udd29")
B.MX=new A.ca("Estar contigo es mi fantas\xeda hecha realidad.","\ud83c\udf08")
B.MZ=new A.ca("Mi amor, eres mi sol, mi luna y todas mis estrellas.","\ud83c\udf1f")
B.MQ=new A.ca("Prometo amarte y cuidarte cada d\xeda de mi vida.","\ud83d\udc8d")
B.MK=new A.ca("Solo quiero envejecer a tu lado.","\ud83d\udc74\ud83d\udc75")
B.MV=new A.ca("Cada momento contigo es un regalo.","\ud83c\udf81")
B.MJ=new A.ca("Eres mi refugio, mi paz y mi alegr\xeda.","\ud83e\uddd8\u200d\u2640\ufe0f")
B.MT=new A.ca("Tu amor es la melod\xeda que alegra mi alma.","\ud83c\udfb6")
B.MW=new A.ca("Contigo, la vida es una obra de arte.","\ud83c\udfa8")
B.MI=new A.ca("Eres la persona que ilumina mis d\xedas m\xe1s oscuros.","\ud83d\udca1")
